<?phpnamespace App\Controller;use Symfony\Bundle\FrameworkBundle\Controller\AbstractController;use Symfony\Component\HttpFoundation\Response;use Symfony\Component\Routing\Annotation\Route;use App\Repository\NewUsersEntityRepository;class AdminDashbordUsersController extends AbstractController{    #[Route('/admin/dashbord/users', name: 'app_admin_dashbord_users')]    public function index(NewUsersEntityRepository $newUserRepository): Response    {        $users = $newUserRepository->findAll();        return $this->render('admin_dashbord/users.html.twig', [            'users' => $users,        ]);    }}